<!DOCTYPE html>
<html lang="ko">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no" />
<title>캠핑장 지도 (요일 선택 반영)</title>
<style>
  body { margin:0; font-family:sans-serif; background:#f7f7fb; }
  header{position:sticky;top:0;background:#fff;z-index:30;border-bottom:1px solid #ccc;}
  .topbar{display:flex;gap:.5rem;align-items:center;padding:.5rem .6rem}
  .tab{flex:1;border:1px solid #ccc;background:#fff;border-radius:.7rem;padding:.5rem .9rem;font-weight:700;text-align:center}
  .tab.active{background:#2563eb;color:#fff;border-color:#2563eb}
  .status{font-size:.9rem;color:#666;padding-left:.25rem;min-width:160px;text-align:right;flex:0 0 auto}
  .wrap{padding:.5rem}
  #stageWrap{height:78vh;background:#fff;border-radius:1rem;box-shadow:0 8px 24px rgba(0,0,0,.06);position:relative;overflow:hidden;touch-action:none}
  #inner{position:absolute;left:0;top:0;transform-origin:0 0;}
  #map{display:block;max-width:none;pointer-events:none;user-select:none;}
  .mark{position:absolute;transform:translate(-50%,-50%);background:rgba(255,255,255,.8);border:1px solid #fff;border-radius:999px;box-shadow:0 2px 6px rgba(0,0,0,.15);padding:.05rem .25rem;white-space:nowrap}
  .mark span{font-weight:800;line-height:1}
  .mark.del{outline:2px dashed #ef4444;outline-offset:2px}
  .drawer{position:fixed;left:0;right:0;bottom:0;background:#fff;border-top:1px solid #ccc;box-shadow:0 -10px 20px rgba(0,0,0,.06);transform:translateY(100%);transition:transform .25s ease;z-index:40}
  .drawer.open{transform:translateY(0)}
  .drawer .handle{width:44px;height:5px;background:#e5e7eb;margin:8px auto;border-radius:8px}
  .drawer .content{padding:.5rem .8rem 1rem .8rem}
  .row{display:flex;gap:.5rem;flex-wrap:wrap;align-items:center}
  button,input[type="color"]{border:1px solid #ccc;background:#fff;border-radius:.7rem;padding:.5rem .9rem;font-weight:700}
  button.small{padding:.35rem .6rem;font-size:.95rem}
  .btn-toggle.active{background:#2563eb;color:#fff;border-color:#2563eb}
  .chip{border:1px solid #ccc;border-radius:1rem;padding:.25rem .6rem;background:#fff;white-space:nowrap}
  .range{width:180px}
  .note{font-size:.9rem;color:#6b7280}
  .zoomBar{position:absolute;left:.75rem;bottom:.75rem;display:flex;gap:.4rem;z-index:20}
  .zoomBar button{width:44px;height:44px;border-radius:999px;box-shadow:0 6px 16px rgba(0,0,0,.12)}
  .wbtn.active{background:#2563eb;color:#fff;border-color:#2563eb}
</style>
</head>
<body>
<header>
  <div class="topbar">
    <button class="tab" data-tab="date">날짜</button>
    <button class="tab" data-tab="tools">기능</button>
    <div class="status" id="modeStatus">라벨: 월 • 일반 모드</div>
  </div>
</header>

<script>
let state={markers:[], color:'#111827', size:20, custom:''};
let activeLayer='MON';
let deleteMode=false;
let scale=1, originX=0, originY=0;
const weekdays=[
  {k:'월',layer:'MON'},{k:'화',layer:'TUE'},{k:'수',layer:'WED'},{k:'목',layer:'THU'},{k:'금',layer:'FRI'},{k:'토',layer:'SAT'},{k:'일',layer:'SUN'}
];
const $=(s)=>document.querySelector(s);
const $$=(s)=>Array.from(document.querySelectorAll(s));
const stage=$("#stageWrap"), inner=$("#inner"), map=$("#map"), drawer=$("#drawer"), drawerContent=$("#drawerContent"), modeStatus=$("#modeStatus"), zoomPct=$("#zoomPct");

function labelName(){ return weekdays.find(w=>w.layer===activeLayer).k; }
function updateStatus(){ modeStatus.textContent = '라벨: ' + labelName() + ' • ' + (deleteMode?'개별삭제 모드':'일반 모드'); }

function setTransform(){ inner.style.transform='translate('+originX+'px,'+originY+'px) scale('+scale+')'; zoomPct.textContent=Math.round(scale*100)+'%'; }
function clamp(v,a,b){ return Math.max(a, Math.min(b, v)); }
function zoomAroundScreenPoint(newScale, mx, my){
  newScale = clamp(newScale, 0.3, 3);
  const rect = stage.getBoundingClientRect();
  const sx = mx - rect.left, sy = my - rect.top;
  const imgX = (sx - originX) / scale;
  const imgY = (sy - originY) / scale;
  scale = newScale;
  originX = sx - imgX * scale;
  originY = sy - imgY * scale;
  setTransform();
}
function zoom(delta){ const r=stage.getBoundingClientRect(); zoomAroundScreenPoint(scale + delta, r.left + r.width/2, r.top + r.height/2); }
$("#zoomIn").onclick=()=>zoom(0.1); $("#zoomOut").onclick=()=>zoom(-0.1);

function stageToImageCoords(clientX,clientY){
  const rect=stage.getBoundingClientRect();
  const x=(clientX-rect.left-originX)/scale;
  const y=(clientY-rect.top-originY)/scale;
  return{x,y};
}
function addMarkerAt(x,y){
  if(deleteMode)return;
  const label=(state.custom||'').trim()||(weekdays.find(w=>w.layer===activeLayer).k);
  const id=String(Date.now())+Math.random().toString(36).slice(2,8);
  state.markers.push({id,x,y,label,color:state.color,size:state.size,layer:activeLayer,visible:true});
  renderAll();
}
function removeMarker(id){state.markers=state.markers.filter(m=>m.id!==id);renderAll();}

const domMap=new Map();
function renderAll(){
  const ids=new Set(state.markers.map(m=>m.id));
  domMap.forEach((el,id)=>{if(!ids.has(id)){el.remove();domMap.delete(id);}});
  state.markers.forEach(m=>{
    let el=domMap.get(m.id);
    if(!el){
      el=document.createElement('div');el.className='mark';el.dataset.id=m.id;
      const span=document.createElement('span');el.appendChild(span);
      inner.appendChild(el);domMap.set(m.id,el);
      el.addEventListener('click',(ev)=>{ev.stopPropagation();if(deleteMode)removeMarker(m.id);});
    }
    el.style.left=m.x+'px';el.style.top=m.y+'px';
    const span=el.querySelector('span');
    span.textContent=m.label;span.style.color=m.color;span.style.fontSize=(m.size||20)+'px';
    el.classList.toggle('del',deleteMode);
  });
  setTransform();
}

function clearAll(){if(!confirm('모두 삭제할까요?'))return;state.markers=[];renderAll();}
function savePNG(){
  const w=Math.round(map.naturalWidth*scale),h=Math.round(map.naturalHeight*scale);
  const c=document.createElement('canvas');c.width=w;c.height=h;const ctx=c.getContext('2d');
  const img=document.getElementById('map');ctx.drawImage(img,0,0,w,h);
  state.markers.forEach(m=>{const x=m.x*scale,y=m.y*scale;ctx.font=`bold ${m.size*scale}px system-ui`;ctx.textAlign='center';ctx.textBaseline='middle';ctx.strokeStyle='#fff';ctx.lineWidth=Math.max(2,m.size/6*scale);ctx.strokeText(m.label,x,y);ctx.fillStyle=m.color||'#111827';ctx.fillText(m.label,x,y);});
  const a=document.createElement('a');a.href=c.toDataURL('image/png');a.download=`camp-map-${new Date().toISOString().slice(0,19).replace(/[T:]/g,'-')}.png`;a.click();
}
function setDeleteMode(on){deleteMode=!!on;updateStatus();const b=$("#btnDelMode");if(b)b.classList.toggle('active',on);domMap.forEach(el=>el.classList.toggle('del',on));}

function openDrawer(tab){
  const tabs=$$('.tab');tabs.forEach(t=>t.classList.toggle('active',t.dataset.tab===tab));drawer.classList.add('open');
  let html='';
  if(tab==='date'){html+=`<div class="row">
    <button class="small wbtn" data-l="MON">월</button>
    <button class="small wbtn" data-l="TUE">화</button>
    <button class="small wbtn" data-l="WED">수</button>
    <button class="small wbtn" data-l="THU">목</button>
    <button class="small wbtn" data-l="FRI">금</button>
    <button class="small wbtn" data-l="SAT">토</button>
    <button class="small wbtn" data-l="SUN">일</button>
    <span class="chip">색상 <input type="color" id="colorInput" value="${state.color}"></span>
  </div>`;
  html+=`<div class="row"><span class="chip">크기 <input type="range" id="sizeInput" min="12" max="40" step="1" value="${state.size}" class="range"></span><span class="chip">라벨 <input id="customInput" placeholder="예: 1, 2, A" style="width:80px" value="${state.custom||''}"></span></div>`;
  } else if(tab==='tools'){html+=`<div class="row">
    <button class="small" id="undoBtn">되돌리기</button>
    <button class="small" id="saveBtn">PNG 저장</button>
  </div>`;
  html+=`<div class="row">
    <button class="small" id="clearBtn">모두 삭제</button>
    <button class="small btn-toggle" id="btnDelMode">개별삭제</button>
  </div>`;
  }
  drawerContent.innerHTML=html;

  $$('.wbtn').forEach(b=>{
    const setDay=()=>{
      activeLayer=b.dataset.l;
      state.custom='';
      updateStatus();
      $$('.wbtn').forEach(x=>x.classList.remove('active'));
      b.classList.add('active');
    };
    b.addEventListener('click',setDay);
    b.addEventListener('touchend',(e)=>{e.preventDefault();setDay();},{passive:false});
  });

  const ci=$("#colorInput");if(ci)ci.addEventListener('input',()=>{state.color=ci.value;});
  const si=$("#sizeInput");if(si)si.addEventListener('input',()=>{state.size=parseInt(si.value,10)||20;renderAll();});
  const cust=$("#customInput");if(cust)cust.addEventListener('input',()=>{state.custom=cust.value;});

  const undo=$("#undoBtn");if(undo)undo.addEventListener('click',()=>{state.markers.pop();renderAll();});
  const save=$("#saveBtn");if(save)save.addEventListener('click',savePNG);
  const clr=$("#clearBtn");if(clr)clr.addEventListener('click',clearAll);
  const del=$("#btnDelMode");if(del){del.addEventListener('click',()=>setDeleteMode(!deleteMode));del.classList.toggle('active',deleteMode);}
}
function closeDrawer(){drawer.classList.remove('open');$$('.tab').forEach(t=>t.classList.remove('active'));}

function init(){
  setTransform();renderAll();updateStatus();
  stage.addEventListener('click',(e)=>{ 
    if(e.target.closest('.mark')||e.target.closest('.drawer')) return;
    const p=stageToImageCoords(e.clientX,e.clientY);
    if(p.x<0||p.y<0)return; addMarkerAt(p.x,p.y);
  });
  $$('.tab').forEach(b=>b.addEventListener('click',()=>{const tab=b.dataset.tab;if(b.classList.contains('active'))closeDrawer();else openDrawer(tab);}));
  drawer.addEventListener('click',(e)=>{if(e.target===drawer)closeDrawer();});
}
init();
</script>
</body>
</html>
